import React, { useEffect, use } from 'react';
import io from 'socket.io-client';

function App() {
  useEffect(() => {
    const socket = io('http://localhost:5000');

    socket.emit('after connect', function(connectMsg: { data: any; }) {
      let logElement = document.getElementById('log');
      const message = `What is the intention of the code: ${connectMsg.data}`;
      logElement?.appendChild(document.createElement('br'));
      logElement ??= document.createElement('div');
      logElement.appendChild(document.createTextNode(message));
    });
  }, []);

  return (
    <div>
      <h1>Example on SocketIO : EduCBA</h1>
      <h2>Message Received:</h2>
      <div id="log"></div>
    </div>
  );
}

export default App;
